import React from 'react';
import './AddStockButton.css';


const AddStockButton = (props) => {
    // console.log(props);
        return (
            <div className="AddStockButton">
               <button className="StockButton" >{props.stock.symbol}</button>
                {props.stock.name}
            </div>
        )

}

export default AddStockButton;
